import React, {useState} from 'react';
import { Link } from 'react-router-dom';
import Modal from 'react-modal';
import home from '../../Icons/home.png';
import profile from '../../Icons/profile.png';
import store from '../../Icons/store.png';
import achievements from '../../Icons/achievements.png';
import settings from '../../Icons/settings.png';

export default function NavBar() {
    const[loginModalIsOpen, setLoginModalIsOpen] = useState(false)
    const[registerModalIsOpen, setRegisterModalIsOpen] = useState(false)
    return (
        <header className="App-header">
            {/* <p><Link to="/login">Login</Link> | <Link to="/register">Register</Link></p> */}
            <Link to="/"><img src={home} className="navBarIcon" alt="home"/></Link>
            <Link to="/profile"><img src={profile} className="navBarIcon" alt="profile"/></Link>
            <Link to="/store"><img src={store} className="navBarIcon" alt="store"/></Link>
            <Link to="/achievements"><img src={achievements} className="navBarIcon" alt="achievements"/></Link>
            <Link to="/settings"><img src={settings} className="navBarIcon" alt="setting"/></Link>

            <button onClick={() => setLoginModalIsOpen(true)}><Link to="/login">Login</Link></button>

            <Modal isOpen={loginModalIsOpen} onRequestClose = {() => setLoginModalIsOpen(false)}>

                <h3>Log In</h3>
                <input type="text" placeholder="username"></input>
                <input type="password" placeholder="password"></input>

                <button type="submit" onClick={() => setLoginModalIsOpen(false)}>Log In</button>
            </Modal>


            <button onClick={() => setRegisterModalIsOpen(true)}><Link to="/register">Register</Link></button>
            <Modal isOpen={registerModalIsOpen} onRequestClose = {() => setRegisterModalIsOpen(false)}>

                <h3>Register</h3>
                <input type="text" placeholder="username"></input>
                <input type="text" placeholder="email"></input>
                <input type="password" placeholder="password"></input>

                <button type="submit" onClick={() => setRegisterModalIsOpen(false)}>Register</button>
            </Modal>



        </header>
    )
}
